import React from "react";
import Navbar from "../navbar/Navbar";

const AddAnime = () => {
  return (
    <div className=" anime-container px-0 2xl:px-16">
      <div className="container mx-auto">
        <Navbar />
      </div>
    </div>
  );
};

export default AddAnime;
